import React, { Component } from 'react'
import { Grommet, Stack, Text, Box, Anchor } from 'grommet';
import { Github } from 'grommet-icons';
import Terminal from 'react-console-emulator'

const commands = {
  echo: {
    description: 'Echo a passed string.',
    usage: 'echo <string>',
    fn: function ()
    {
      return `${Array.from(arguments).join(' ')}`
    }
  }
}

export default class App extends Component
{
  render ()
  {
    return (
      <Grommet themeMode="dark" full>
        <Stack anchor="center" fill>
          <Terminal
            contentStyle={{ 'overflow-x': 'hidden', 'word-wrap': 'break-word' }}
            style={{ minHeight: '100%', minWidth: '100%', borderRadius: '0' }}
            commands={commands}
            promptLabel={'> '}
          />
          <Box border={{ color: 'brand', size: 'large', style: 'double', side: 'horizontal' }} pad="medium" alignContent='center'>
            <Text size='xxlarge' color="status-critical" textAlign='center' margin='small'>
              Kyle Martin
              <p />
              Computer Engineer
            </Text>
            <Box alignSelf='center' direction='row' gap='medium'>
              <Anchor icon={<Github />} hoverIndicator />
              <Github size='large' href='https://github.com/KyleMiles' />
            </Box>
          </Box>
        </Stack>

      </Grommet >
    )
  }
}
